    methods
        function obj=battery(batterycapacity,body)
            
            obj.capacity=batterycapacity;
            obj.seriescells=ceil(obj.motorvoltage/obj.nominalcellvoltage);  %number of series 4.2V cells to achieve 420V for motor
            obj.parallelcells=ceil(batterycapacity*1000/(obj.nominalcellvoltage*obj.cellcapacity*obj.seriescells));
            obj.mass=(batterycapacity/(obj.specificbatteryweight))*1000;
            obj.cost=obj.specificbatterycost*obj.capacity;
           
        end
        
        function obj=maxstoragecapacity(obj,wheelbase,bodywidth,wheelhousingwidth,...
               rearoverhang,tyrediameter,floorheight,sectionheight,groundclearance)
            %maxheight=175;
            if obj.position==1
            maxlength=wheelbase-1.5*tyrediameter;
            maxwidth= bodywidth-2*wheelhousingwidth-2*sectionheight-5; % section height and width are equal
            maxheight=floorheight-groundclearance-30; % 30 mm for ramp
            else
            maxlength=wheelbase-1.5*tyrediameter;
            maxwidth= bodywidth-2*wheelhousingwidth;
            maxheight=floorheight-sectionheight-groundclearance-5;
            end
            maxvolume=maxlength/1000*maxwidth/1000*maxheight/1000 *1000;
            obj.maxcapacity=maxvolume*obj.volumetricenergydensity/1000;
            obj.width=maxwidth;
            obj.height=maxheight;
        end
        function emissions=batteryemissions(obj)
            emissions.CO2=(obj.mass*obj.replacements*.63*27.4137)+(obj.mass*obj.replacements*.37*24.5588); % CO2 emissions of cell+housing %24.79118716 %21.937479
       %     emissions.DCB=(obj.mass*obj.replacements*.63*29.11545727)+(obj.mass*obj.batterylife*.37*26.27587); % DCB emissions of cell+housing
        %    emissions.PM10=(obj.mass*obj.replacements*.63*0.1269670696)+(obj.mass*obj.batterylife*.37*0.050547); % PM-10 
        end
        function plotbattery(obj,position,handle)
          %  calculate the battery pack dimensions
            if ~isempty(obj.width)
                if obj.maxcapacity<obj.capacity
                    disp('Battery capacity exceeds available space')
                  return  
                end
                if obj.position==1
                      packwidth=obj.width;
                packheight=obj.height;
                packlength=(obj.capacity*1000/obj.volumetricenergydensity)/(packwidth/1000*packheight/1000);
              position=[0 0 packheight/2+2]; % 2mm tolerance
                     
                else
              
                packwidth=obj.width;
                packheight=obj.height;
                packlength=(obj.capacity*1000/obj.volumetricenergydensity)/(packwidth/1000*packheight/1000);
                  position=[0 0 packheight/2+100]; % 105 is frameheight (battery on top of frame)
                end
            else
            cellheight=65; %18650 cell
            cellwidth=18; %diameter 18650
            spacebetweencells=2; %mm
            bmsthickness=10; %mm
            
            packheight=cellheight+bmsthickness;
            packwidth=obj.parallelcells*(cellwidth+spacebetweencells);
            packlength=obj.seriescells*(cellwidth+spacebetweencells);
            if packlength<packwidth %rotate pack 
               l=packlength;
               packlength=packwidth;
               packwidth=l;
            end
            end
            % define vertices
            v1=[-0.5*packlength;0.5*packwidth;-0.5*packheight];
            v2=[0.5*packlength;0.5*packwidth;-0.5*packheight];
            v3=[0.5*packlength;0.5*packwidth;0.5*packheight];
            v4=[-0.5*packlength;0.5*packwidth;0.5*packheight];
            v5=[-0.5*packlength;-0.5*packwidth;0.5*packheight];
            v6=[0.5*packlength;-0.5*packwidth;0.5*packheight];
            v7=[0.5*packlength;-0.5*packwidth;-0.5*packheight];
            v8=[-0.5*packlength;-0.5*packwidth;-0.5*packheight];
            Vertices=[v1,v2,v3,v4,v5,v6,v7,v8];
           
            Vertices=obj.translate(Vertices,position);
            colr=[1 0 0];
            patch(handle,'Faces',[1 2 3 4
                5 6 7 8
                4 3 6 5
                3 2 7 6
                2 1 8 7
                1 4 5 8],'Vertices',Vertices','FaceColor',colr);
%             text(handle,position(1),position(2),position(3),'Battery');
        end
        function vertices=translate(obj,vertices,position)
            T= [1 0 0  position(1);0 1 0  position(2);0 0 1  position(3);0 0 0 1] ;
            vertices(4,:)=1;
            vertices=(T*vertices);
            vertices=vertices(1:3,:);
        end
        function [Pbat,SOC,Vbat,Ploss,etabat]=power(battery,I_target,initSOC)
            %calculates SOC
            cell_I=-(I_target/battery.parallelcells); %cell current
            dsoc=(cell_I*battery.h)/(battery.cellcapacity*3600); %delta SOC h is timestep?
            SOC=dsoc+initSOC; %SOC
            if SOC>1
                SOC=1;
            elseif SOC<0.1
                SOC=0.1;
            end
            C_rate=cell_I/battery.cellcapacity; %C-rate
            
            %% equivalent circuit model
            %             OCV=interp1(battery.SOCtoOCV(:,1),battery.SOCtoOCV(:,2),SOC); % calculates Open-circuit voltage of cell from SOC
            OCV=lininterp1(battery.SOCtoOCV(:,1),battery.SOCtoOCV(:,2),SOC); % calculates Open-circuit voltage of cell from SOC
            
            SOCi=SOC;
            C_ratei=C_rate;
            if SOC>0.9
                SOC=0.9;
            end
            if SOC<0.1
                SOC=0.1;
            end
            if C_rate>1
                C_rate=1;
            end
            if C_rate<-3
                C_rate=-3;
            end
            
            %             Cell_Internalresistance=interp3(battery.Ri.C_rate,battery.Ri.SOC,battery.Ri.T,battery.Ri.LT,C_rate,SOC,battery.celltemperature); % looks up cell internal resistance
            %             Cell_Internalresistance=interp2(battery.Ri.C_rate,battery.Ri.SOC,battery.Ri.LT,C_rate,SOC); % looks up cell internal resistance
            
            Cell_Internalresistance=lininterp2(battery.Ri.C_rate,battery.Ri.SOC,battery.Ri.LT,C_rate,SOC); % looks up cell internal resistance
            
            I=C_rate*battery.cellcapacity; %current
            Vdrop=I*Cell_Internalresistance; %voltage drop due to internal resistance
            
            Vcell=OCV+Vdrop; % cell terminal voltage
            
            %% pack level calculation
            Internalresistance=Cell_Internalresistance*battery.seriescells/(I_target/battery.parallelcells); %Pack internal resistance
            Vbat=Vcell*battery.seriescells; %battery pack voltage
            Pbat_target=I_target*Vbat; %target power
            Ploss=((cell_I^2)*Cell_Internalresistance)*battery.parallelcells*battery.seriescells; %Battery pack power loss
            Pbat=Pbat_target-Ploss; %delivered power from battery
            etabat=(Pbat-Ploss)/Pbat;
            SOC=SOCi;
            C_rate=C_ratei;
        end
        function [I_target]=controller(battery,P_motor,V_bat,P_aux)
            I_target=(P_aux/V_bat)+(P_motor/V_bat); %target current requested
            I_up=battery.parallelcells*battery.cellcapacity*battery.C_ratemax;
            I_low=battery.parallelcells*battery.cellcapacity*battery.C_ratemaxc*-1;
            
            if I_target>I_up
                I_target=I_up;
            elseif I_target<I_low
                I_target=I_low;
            end
        end
        
